import { useState } from "react";
import "./PasswordInput.css";

export default function PasswordInput({ value, onChange, ...props }) {
  const [show, setShow] = useState(false);

  return (
    <div className="password-input">
      <input
        {...props}
        type={show ? "text" : "password"}
        value={value}
        onChange={onChange}
      />
      <button
